import axios from "axios"


const getTrending= async ()=>{ 
        try {
            const axiosRequest= await axios.get("https://api.themoviedb.org/3/trending/all/day?api_key=5f4cf67aa6b81c56e16cff977537cf17")
            const trending= axiosRequest.data.results
            return trending }
        catch (error) {
            console.log(error)}
        }


export default getTrending
